<script>
    function increment() {
        var numberInput = document.getElementById(""number"");
        var currentValue = parseInt(numberInput.value);
        if (currentValue < 100) {
            numberInput.value = currentValue + 1;
        }
    }
    function decrement() {
        var numberInput = document.getElementById(""number"");
        var currentValue = parseInt(numberInput.value);
        if (currentValue > 1) {
            numberInput.value = currentValue - 1;
        }
    }
</script>");
